import React, { Component } from "react";

import "./save.css";

export default class Save extends Component {
  render() {
    return (
      <div className="headRes">
        <div className="head">
          <Row>
            <Col>
              <h1 style={{ textAlign: "center" }}>(React) GOOGLE BOOKS</h1>
              <h2 style={{ textAlign: "center" }}>Search and Save Books</h2>
            </Col>
          </Row>
        </div>
      </div>
    );
  }
}
